The recipe for happiness is simple. 

Happiness is a state of mind. It cannot be found in the material things about us, such as wealth, power or fame.

Those who spend a lifetime harvesting and accumulating more wealth than they need will be disillusioned and disappointed when they discover, only too late, that all the money in the world cannot buy a grain of lasting happiness. Wealth is not bad in itself. Of course wealth can be a source of physical comfort and the sense of wellbeing that comes with using it wisely for the benefit of others. However, what is bad is the attachment to that wealth, which is a source of suffering. 

We must also distinguish between pleasure and happiness. The search for pleasure must not be confused with the search for happiness. Pleasure is a passing show and does not offer lasting happiness. Pleasure can be bought, but not happiness. Happiness comes from within, based on the foundation of simple goodness and clear conscience.

No one is happy unless there is contentment within. The quest for mental tranquility is only possible through mental culture and meditation. 

‘Happiness is a perfume you cannot pour on others without getting a few drops on yourself.’

If you want to live peacefully and happily, allow others also to live peacefully and happily.

